import React from "react";
import "../stylesheets/style.css";
import url from "../data/pokeData.json";

const Pokemon = (props) => {
  return (
    <div>
      <img className="pokeClass" src={`"${props.url}"`} />
      <h1>Pokemons: {props.name}</h1>
    </div>
  );
};

export default Pokemon;
